"INSERT INTO `".$prefix."category` (`id`, `title`, `url`, `parent`, `parent_url`, `sort`, `html_content`, `meta_title`, `meta_keywords`, `meta_desc`, `invisible`, `1c_id`, `image_url`, `rate`) VALUES
(9, 'Компьютерная техника', 'kompyuternaya-tehnika', 0, '', 9, '<p>Компьютерная техника – это самые современные устройства, которые помогут решить множество рутинных задач, а также наполнить Ваш отдых новыми впечатлениями. Компьютеры и ноутбуки для работы, учебы и развлечений. Множество аксессуаров и&nbsp;полезных приложений.</p>', 'Компьютерная техника', 'Планшеты, ноутбуки, компьютеры', 'Компьютерная техника – это самые современные устройства, которые помогут решить множество рутинных задач, а также наполнить Ваш отдых новыми впечатлениями. Компьютеры и ноутбуки для работы, учебы и развлечений. Множество аксессуаров и полезных приложений.', 0, '', '/uploads/kompyuter-noutbuk.png', 0),
(10, 'Компьютеры и ноутбуки', 'kompyuteryi-i-noutbuki', 9, 'kompyuternaya-tehnika/', 10, '<p>Широкий выбор компьютеров - от настольных до плнаншетных.&nbsp;Вы легко подберете необходимую&nbsp;модель для любых целей, как для школьника, офисного работника, так и для инженера и геймера.&nbsp;</p>\n', '', '', '', 0, '', '/uploads/kompyuter-noutbuk.png', 0),
(11, 'Устройства ввода', 'ustroystva-vvoda', 9, 'kompyuternaya-tehnika/', 11, '<p>Устройства ввода включают в себя мышки, клавиатруры, микрофоны и другие необходимые комплектующие&nbsp;для эффективной работы за компьютером.&nbsp;</p>\n', 'Устройства ввода', 'Мышки, клавиатуры, микрофоны', 'Устройства ввода включают в себя мышки, клавиатруры, микрофоны и другие необходимые комплектующие для эффективной работы за компьютером. ', 0, '', '/uploads/input_devices.png', 0),
(12, 'Ноутбуки', 'noutbuki', 10, 'kompyuternaya-tehnika/kompyuteryi-i-noutbuki/', 12, '<p>Ноутбук - возьмите с собой на работу или учебу. Мощные процессоры ускорят процесс работы.</p>\n', 'Ноутбуки', 'Ноутбуки', 'Ноутбук - возьмите с собой на работу или учебу. Мощные процессоры ускорят процесс работы.', 0, '', '/uploads/noutbuk-Dell-Inspiron-N411Z.png', 0.1),
(13, 'Планшеты', 'planshetyi', 10, 'kompyuternaya-tehnika/kompyuteryi-i-noutbuki/', 13, '<p>Доступ к Интренту и необходимым документам - практически из любой точки, где бы Вы не находились.&nbsp;</p>\n', 'Планшеты', 'Планшеты', 'Доступ к Интренту и необходимым документам - практически из любой точки, где бы Вы не находились. ', 0, '', '/uploads/samsung-t531-galaxy-tab-turn1413891200.png', 0),
(14, 'Компьютерные мыши', 'myishi', 11, 'kompyuternaya-tehnika/ustroystva-vvoda/', 14, '<p>В разделе мыши нашего интернет-магазина можно выбрать мыши по характеристикам, почитать отзывы других покупателей, сравнить описания понравившихся моделей и цены.&nbsp;</p>\n', '', '', '', 0, '', '/uploads/mysh-QUMO-Dragon-War-Phantom.png', 0),
(15, 'Клавиатуры', 'klaviaturyi', 11, 'kompyuternaya-tehnika/ustroystva-vvoda/', 15, '<p>В разделе клавиатуры нашего интернет-магазина можно выбрать клавиатуры по характеристикам, почитать отзывы других покупателей, сравнить описания понравившихся моделей и цены.</p>\n', 'Клавиатуры', 'Клавиатуры игровые, клавиатуры для работы', 'В разделе клавиатуры нашего интернет-магазина можно выбрать клавиатуры по характеристикам, почитать отзывы других покупателей, сравнить описания понравившихся моделей и цены.', 0, '', '/uploads/klaviatura-dlya-tv-SAMSUNG-VG-KBD1000.png', -0.05),
(16, 'Информационные носители', 'informatsionnyie-nositeli', 9, 'kompyuternaya-tehnika/', 16, '<p>Для хранения и переноса информации с одного компьютера на другие удобно использовать внешние носители. В качестве носителей информации чаще всего выступают оптические диски (CD, DVD, Blu-ray), флеш-накопители (флешки) и внешние жесткие диски.<br />\n&nbsp;</p>\n', 'Информационные носители', 'Флешки, карты памяти', 'Информационные носители', 0, '', '/uploads/vnutrenniy-SSD-nakopitel-Samsung-MZ-7TE1T0BW.png', 0),
(17, 'Двери', 'dveri', 0, '', 17, '<p>Конструкции дверных полотен весьма разнообразны. Дверное полотно из массива дерева может состоять как из единого куска, так и набранного из разной древесины, в соответствии с конструктивными и эксплуатационными характеристиками пород древесины. Набранные из разных пород дверные полотна обычно облицовываются шпоном ценных пород дерева и отделываются нитролаками и эмалями.</p>\n', 'Двери', 'Двери', 'Дверное полотно из массива дерева может состоять как из единого куска, так и набранного из разной древесины, в соответствии', 0, '', '/uploads/balestra2.png', 0.3),
(18, 'Продукты питания', 'produktyi-pitaniya', 0, '', 18, '<p>Закажите пиццу, салаты, дисерт, выбрав состав&nbsp;по своему вкусу!</p>', 'Продукты питания', 'Продукты питания', 'Закажите пиццу, салаты, дисерт, выбрав состав по своему вкусу!', 0, '', '/uploads/chizkejk.png', 0)",


