(32, 33, 13, 'Планшет Samsung Galaxy Tab S 8.4 SM-T700', '<p>Планшет Samsung Galaxy Tab S 8.4 SM-T700 - мощная многозадачная модель с Super AMOLED-экраном, мощной восьмимегапиксельной камерой, GPS-навигатором и свежей операционной системой Google Android 4.4. Она базируется на восьмиядерном процессоре Samsung Exynos Octa 5420, который обеспечивает быструю работу в любых приложениях.</p><p></p>', 19990, 'planshet-samsung-galaxy-tab-s-8-4-sm-t700', 'planshet-Samsung-Galaxy-Tab-S-8.4-SM-T700.png|samsung-t531-galaxy-tab-back1414885850.png', '2060B', -1, 1, 'Планшет Samsung Galaxy Tab S 8.4 SM-T700', 'Планшет Samsung Galaxy Tab S 8.4 SM-T700', 'Планшет Samsung Galaxy Tab S 8.4 SM-T700 - мощная многозадачная модель с Super AMOLED-экраном, мощной восьмимегапиксельной камерой, GPS-навигатором и свежей операционной системой Google Android 4.4. Она базируется на восьмиядерном процессоре Samsung Exynos Octa 5420, который обеспечивает быструю работу в любых приложениях.', '', 0, 0, '1905С,1089К,6790F,4560k', '', '', 0.3, '', 'RUR', 19990, '|', '|', '', 0),
