(56, 56, 18, 'Пицца', '<p>Собери свою пиццу на любой вкус!</p><p>Пицца (итал. pizza от итал. pizzicare быть острым) — итальянское национальное блюдо в виде круглой открытой лепешки, покрытой в классическом варианте томатами и расплавленным сыром.</p>', 200, 'pitstsa', 'pizza.png', '445Ps', -1, 1, 'Пицца', 'пицца, тонкая основа, толстая основа', 'Пицца (итал. pizza от итал. pizzicare быть острым) — итальянское национальное блюдо в виде круглой открытой лепешки, покрытой в классическом варианте томатами и расплавленным сыром.', '', 0, 0, '520des,4516s,2009M,4520K,1006A', '', '', 0.5, '', 'RUR', 200, '', '', '', 1),
