(37, 40, 14, 'Мышь APPLE Wired Mighty Mouse MB112ZM/B', '<p>Общие: Соединение — Проводное,<br />Тип — Оптическая,<br />Интерфейс — USB<br />Корпус: Количество клавиш — 5<br />Цвет: белый</p>', 1990, 'myish-apple-wired-mighty-mouse-mb112zm-b', 'mysh-APPLE-MAGIC-MOUSE-White-MB829ZM.png', '2980M', -1, 1, 'Мышь APPLE Wired Mighty Mouse MB112ZM/B', 'Мышь APPLE Wired Mighty Mouse MB112ZM/B', 'Проводная оптическая компьютерная мышь от компании Apple.', '2009', 0, 0, '10002A,2004F0b,1007D', '', '', 0, '', 'RUR', 1990, '', '', '', 0),
(38, 41, 14, 'Мышь APPLE MAGIC MOUSE White MB829ZM/A', '<p>Общие: Соединение — Беспроводное,<br />Тип — Оптическая,<br />Интерфейс — Bluetooth<br />Цвет: белый</p>', 2790, 'myish-apple-magic-mouse-white-mb829zm-a', 'mysh-APPLE-Wired-Mighty-Mouse-MB112ZM.png', '2009M', -1, 1, 'Мышь APPLE MAGIC MOUSE White MB829ZM/A', 'Мышь APPLE MAGIC MOUSE, белая мышка, компьютерная мышь', 'Беспроводная оптическая крутая компьютерная Мышь APPLE MAGIC MOUSE White MB829ZM/A.', '', 0, 1, '1004С,1006A,340К,1054C', '', '', 0, '', 'RUR', 2790, '', '', '', 0),
(39, 42, 14, 'Мышь LOGITECH Wireless Mouse M235 Grey-Black', '<p>Общие: Соединение — Беспроводное,<br />Тип — Оптическая,<br />Интерфейс — USB<br />Корпус: Количество клавиш — 3<br />Цвет: серый, черный</p>', 790, 'myish-logitech-wireless-mouse-m235-grey-black', 'mysh-LOGITECH-Wireless-Mouse-M235-Grey-Black.png', '390M', -1, 1, 'Мышь LOGITECH Wireless Mouse M235 Grey-Black', 'Мышь LOGITECH Wireless Mouse M235 Grey-Black', 'Беспроводная удобная оптическая Мышь LOGITECH Wireless Mouse M235 Grey-Black, серого и черного цветов, подключается через USB.', '', 0, 0, '1905С,1054C,10105A', '', '', 0, '', 'RUR', 790, '', '', '', 0),
(40, 43, 14, 'Мышь SAMSUNG S Action White', '<p>Общие: Соединение — Беспроводное,<br />Тип — Оптическая,<br />Разрешение сенсора — 1600 dpi,<br />Интерфейс — Bluetooth<br />Корпус: Количество клавиш — 4<br />Цвет: Белый</p>', 2790, 'myish-samsung-s-action-white', 'mysh-SAMSUNG-S-Action-White.png', '2340v', -1, 1, 'Мышь SAMSUNG S Action White', 'Мышь SAMSUNG S Action White, новинка, компьютерная мышь, стильный дизайн', 'Беспроводная оптическая Мышь SAMSUNG S Action White. Новинка.', '', 1, 1, '10105A,10024Bw,20008V', '', '', 0, '', 'RUR', 2790, '', '', '', 4),
(41, 24, 15, 'Клавиатура DEFENDER Warhead GK-1300L', '<p>Общие: Соединение — Проводное,<br />Тип — Игровая,<br />Интерфейс — USB<br />Рабочая область: Подсветка клавиш — Есть,<br />Количество дополнительных клавиш — 8<br />Цвет: Черный</p>', 1390, 'klaviatura-defender-warhead-gk-1300l', 'klaviatura-DEFENDER-Warhead-GK-1300L.png', '340К', -1, 1, 'Клавиатура DEFENDER Warhead GK-1300L', 'Клавиатура DEFENDER Warhead, клавиатура', 'Игровая удобная Клавиатура DEFENDER Warhead GK-1300L черного цвета.', '', 1, 0, '1001A,10954M,20008V', '', '', 0, '', 'RUR', 1390, '', '', '', 0),
(42, 44, 15, 'Клавиатура для ТВ SAMSUNG VG-KBD1000', '<p>Клавиатура для SMART-телевизоров Samsung: LED от ES6100 и выше, плазменные от PDP E550 и выше. Совместима с планшетами и смартфонами Samsung с операционной системой Android 3.0 и выше.</p><p>Общие: Соединение — Беспроводное,<br />Тип — Мембранная,<br />Интерфейс — Bluetooth<br />Рабочая область: Количество клавиш — 90<br />Цвет: черный</p>', 2300, 'klaviatura-dlya-tv-samsung-vg-kbd1000', 'klaviatura-dlya-tv-SAMSUNG-VG-KBD1000.png', '4560k', -1, 1, 'Клавиатура для ТВ SAMSUNG VG-KBD1000', 'Клавиатура для ТВ SAMSUNG VG-KBD1000', 'Беспроводная клавиатура для SMART-телевизоров Samsung: LED от ES6100 и выше, плазменные от PDP E550 и выше. Совместима с планшетами и смартфонами Samsung с операционной системой Android 3.0 и выше.', '', 0, 0, '1007D,2060B,2340v', '', '', 0, '', 'RUR', 2300, '', '', '', 0),
(43, 45, 15, 'Клавиатура APPLE Wireless Keyboard MC184RS/A', '<p>Ультратонкий дизайн.<br />Общие: Соединение — Беспроводное,<br />Тип — Мембранная,<br />Интерфейс — Bluetooth<br />Рабочая область: Количество клавиш — 78<br />Цвет: белый, серебристый</p>', 2890, 'klaviatura-apple-wireless-keyboard-mc184rs-a', 'klaviatura-APPLE-Wireless-Keyboard-MC184RS.png|apple-keyboard-side.jpg', '390K', -1, 1, 'Клавиатура APPLE Wireless Keyboard MC184RS/A', 'Клавиатура APPLE Wireless Keyboard, ультратонкая, дизайн стильный', 'Ультратонкий дизайн клавиатура APPLE Wireless Keyboard беспроводное соединение, подключение через bluetooth.', '', 0, 0, '1007D,2009M,2980M', '', '', 0, '', 'RUR', 2890, '|', '|', '', 7),
(44, 38, 15, 'Клавиатура-чехол LOGITECH Ultrathin Keyboard Cover', '<p>Общие: Соединение — Беспроводное,<br />Тип — Мембранная,<br />Собственный аккумулятор, <br />Интерфейс — Bluetooth<br /><span style=\"line-height: 1.6em;\">Рабочая область:</span><span style=\"line-height: 1.6em;\"> Количество клавиш — 64</span><br /><span style=\"line-height: 1.6em;\">Цвет:</span><span style=\"line-height: 1.6em;\"> белый</span></p>', 2390, 'klaviatura-chehol-logitech-ultrathin-keyboard-cover', 'klaviatura-chehol-LOGITECH-Ultrathin-Keyboard-Cover.png|logitech-cover-for-ipad.jpg', '460Kc', -1, 1, 'Клавиатура-чехол LOGITECH Ultrathin Keyboard Cover for iPad White', 'Клавиатура-чехол LOGITECH Ultrathin Keyboard Cover for iPad White', 'Беспроводная с собственным аккумулятором клавиатура-чехол LOGITECH Ultrathin Keyboard Cover for iPad White', '', 0, 1, '2980M,390K,1007D', '', '', 0, '', 'RUR', 2390, '|', '|', '', 0),
(45, 32, 15, 'Клавиатура QUMO Dragon War Desert Eagle GK-001', '<p>Общие: Соединение — Проводное,<br />Тип — Игровая,<br />Интерфейс — USB<br />Рабочая область: Количество клавиш — 104,<br />Количество дополнительных клавиш — 10<br />Цвет: черный</p>', 1090, 'klaviatura-qumo-dragon-war-desert-eagle-gk-001', 'klaviatura-QUMO-Dragon-War-Desert-Eagle-GK-001.png', '390K', -1, 1, 'Клавиатура QUMO Dragon War Desert Eagle GK-001', 'Клавиатура QUMO Dragon War Desert Eagle GK-001', 'Игровая крутая Клавиатура QUMO Dragon War Desert Eagle GK-001 с дополнительными клавишами.', '1390', 1, 1, '10954M,1054C,1078M', '', '', 0, '', 'RUR', 1090, '', '', '', 0),
(46, 46, 15, 'Клавиатура GENIUS KB200', '<p>Общие: Соединение — Проводное,<br />Тип — Мембранная,<br />Интерфейс — USB, PS/2<br />Рабочая область: Количество дополнительных клавиш — 12 с подставкой под запястья</p>', 290, 'klaviatura-genius-kb200', 'klaviatura-GENIUS-KB200.png', '290K', -1, 1, 'Клавиатура GENIUS KB200', 'Клавиатура GENIUS KB200', 'Проводная удобная Клавиатура GENIUS KB200 с подставкой под запястья.', '', 0, 0, '1001A,1004C,2004F0b', '', '', 0, '', 'RUR', 290, '', '', '', 0),
(47, 47, 16, 'USB-флешка QUMO 16GB OPTIVA 01', '<p>Общие характеристики: Тип USB — 2.0</p><p>Память: Объем — 16384 Мб</p><p>Цвет: красный</p>', 380, 'usb-fleshka-qumo-16gb-optiva-01', 'qumo-flash.png', '6790F', -1, 1, 'USB-флешка QUMO 16GB OPTIVA 01', 'USB-флешка QUMO 16GB OPTIVA 01', 'Совместимая со всеми операционными системами флешка, носитель информации 16 Гб.', '', 0, 0, '10034B,1086S,340К', '', '', 0, '', 'RUR', 380, '', '', '', 0),
(48, 48, 16, 'USB-флешка QUMO 16 GB Lex 3.0', '<p>USB-флешка, носитель информации</p><p>Материал: хромированная сталь, кожа</p><p>Общие характеристики: Тип USB — 3.0</p><p>Память: Объем — 16 Гб</p><p style=\"margin: 0px 0px 8px; color: rgb(63, 69, 75); font-family: Helvetica, Arial, sans-serif; font-size: 11px; line-height: 14px;\"></p>', 600, 'usb-fleshka-qumo-16-gb-lex-3-0', 'qumo-flash-white.png', '0390FW', -1, 1, 'USB-флешка QUMO 16 GB Lex 3.0', 'USB-флешка QUMO 16 GB Lex 3.0', 'USB-флешка, носитель информации из хромированной стали и кожи. Тип USB — 3.0 Память: Объем — 16 Гб.', '', 1, 0, '5609R,10002A,290K', '', '', 0.024, '', 'RUR', 600, '', '', '', 5),
(49, 49, 16, 'Карт-ридер DEFENDER OPTIMUS', '<p>Комплект: Картридер, Кабель USB 2.0 A(M) - MiniB (M) длина 1 м для подключения к ПК, Гарантийный талон, </p><p>Поддерживает 85 различных типов карт<br />Позволяет читать до 4 типов карт одновременно<br />Поддерживает 85 различных типов карт<br />Не требует драйвера</p><p>Материал пластик, резина. </p><p></p><p></p>', 550, 'kart-rider-defender-optimus', 'usb-hub-defender-quadro-quick-0.png|defender-cardreader.jpg', '5609R', -1, 1, 'Карт-ридер DEFENDER OPTIMUS', 'Карт-ридер DEFENDER OPTIMUS', 'Card reader Defender Optimus - миниатюрное устройство, работающее со всеми типами памяти и совместимо с USB 2.0. Покрытие корпуса прорезинено. Картридер позволяет читать до 4 карт одновременно.', '', 1, 1, '4560k,460Kc,2980M,10002A', '', '', 0, '', 'RUR', 550, '|', '|', '', 0),
(50, 50, 16, 'Карта памяти Sony SR32UYAT micro SDHC', '<p>Карта памяти Sony SR32UYAT microSDHC 32Гб class 10 поставляется с адаптером. Маленький и очень легкий носитель обеспечит надежное хранение данных и их быстрое копирование. Скорость чтения карты достигает 40 Мб/с. Карта памяти Sony SR32UYAT microSDHC 32Гб class 10 подойдет к различным устройствам – электронным книгам, смартфонам и так далее.</p>', 1990, 'karta-pamyati-sony-sr32uyat-micro-sdhc', 'karta-pamyati-Sony-SR32UYAT-micro-SDHC.png', '1089К', -1, 1, 'Карта памяти Sony SR32UYAT micro SDHC', 'Карта памяти Sony SR32UYAT micro SDHC', 'Карта памяти Sony SR32UYAT microSDHC 32Гб class 10 поставляется с адаптером. Маленький и очень легкий носитель обеспечит надежное хранение данных и их быстрое копирование. Скорость чтения карты достигает 40 Мб/с. Карта памяти Sony SR32UYAT microSDHC 32Гб class 10 подойдет к различным устройствам – электронным книгам, смартфонам и так далее.', '', 0, 0, '0390FW,6790F,5609R', '', '', 0, '', 'RUR', 1990, '', '', '', 0),
(51, 51, 16, 'Карта памяти Sony SR64UYAT micro SDXC', '<p>Благодаря карте памяти Sony SR64UYAT micro SDXC 64Гб class 10 можно сохранить сотни фотографий, фильмов и аудиофайлов на смартфоне, планшетном компьютере или другом совместимом устройстве, значительно расширив его емкость. Прилагаемый адаптер для карт памяти SD полного размера позволяет с легкостью передавать данные на ноутбук или устройства, совместимые SD полного размера. Карта демонстрирует высокую надежность, устойчивость к рентгеновскому излучению, экстремальным температурам и ударопрочность.</p>', 3190, 'karta-pamyati-sony-sr64uyat-micro-sdxc', 'karta-pamyati-Sony-SR64UYAT-micro-SDXC1414879464.png', '4520K', -1, 1, 'Карта памяти Sony SR64UYAT micro SDXC', 'Карта памяти Sony SR64UYAT micro SDXC', 'Благодаря карте памяти Sony SR64UYAT micro SDXC 64Гб class 10 можно сохранить сотни фотографий, фильмов и аудиофайлов на смартфоне, планшетном компьютере или другом совместимом устройстве, значительно расширив его емкость. Прилагаемый адаптер для карт памяти SD полного размера позволяет с легкостью передавать данные на ноутбук или устройства, совместимые SD полного размера. Карта демонстрирует высокую надежность, устойчивость к рентгеновскому излучению, экстремальным температурам и ударопрочность.', '', 1, 0, '460Kc,1089К,5609R', '', '', 0, '', 'RUR', 3190, '', '', '', 0),
(52, 52, 16, 'Карта памяти Samsung MicroSDHC', '<p>Карта памяти для фотоаппарата Samsung MicroSDHC 32Gb Pro обеспечивает быструю запись и надежное хранение данных, она не боится воды, воздействия магнитных полей, экстремальных температур, радиоактивного излучения в системах контроля багажа, установленных в аэропортах. С ее помощью владелец сможет снять еще больше фото- и видеоматериалов, не задумываясь об экономии свободного места. В комплект входит адаптер, позволяющий использовать карту с камерами, оснащенными слотом SD.</p>', 2690, 'karta-pamyati-samsung-microsdhc', 'karta-pamyati-Samsung.png', '1905С', -1, 1, 'Карта памяти Samsung MicroSDHC', 'Карта памяти Samsung MicroSDHC', 'Карта памяти для фотоаппарата Samsung MicroSDHC 32Gb Pro обеспечивает быструю запись и надежное хранение данных, она не боится воды, воздействия магнитных полей, экстремальных температур, радиоактивного излучения в системах контроля багажа, установленных в аэропортах. С ее помощью владелец сможет снять еще больше фото- и видеоматериалов, не задумываясь об экономии свободного места. В комплект входит адаптер, позволяющий использовать карту с камерами, оснащенными слотом SD.', '', 1, 1, '4520K,1089К,5609R', '', '', 0, '', 'RUR', 2690, '', '', '', 0),
(53, 53, 16, 'Внутренний SSD накопитель Samsung MZ-7TE1T0BW', '<p>Внутренний SSD-накопитель Samsung MZ-7TE120BW 1Тб Sata III – это идеальное решение для ежедневных задач. С его помощью можно открывать веб-страницы, создавать документы, играть, просматривать и редактировать мультимедийные файлы, а также осуществлять множество других действий быстро и легко.</p>', 18250, 'vnutrenniy-ssd-nakopitel-samsung-mz-7te1t0bw', 'vnutrenniy-SSD-nakopitel-Samsung-MZ-7TE1T0BW.png', '1086S', -1, 1, 'Внутренний SSD накопитель Samsung MZ-7TE1T0BW', 'Внутренний SSD накопитель Samsung MZ-7TE1T0BW', 'Внутренний SSD-накопитель Samsung MZ-7TE120BW 1Тб Sata III – это идеальное решение для ежедневных задач. С его помощью можно открывать веб-страницы, создавать документы, играть, просматривать и редактировать мультимедийные файлы, а также осуществлять множество других действий быстро и легко.', '18790', 1, 0, '0390FW,6790F,1006A,10105A', '', '', 0, '', 'RUR', 18250, '', '', '', 3)",


